import { BrowserRouter, Routes, Route } from "react-router-dom";
import products from "./pages/Products";
import update from "./pages/Update";

function App() {
  return (
    <div className="App">
      <BrowserRouter >
        <Routes>
          <Route path="/" element={products} />
          <Route path="/update" element={update} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
